import React, { useState, useEffect } from 'react';
import { Button, Form, Container } from 'react-bootstrap';

function UserRegistration() {
    const [email, password, setEmail, setPassword, setRePassword] = useState("");
    const handleSubmit = (evt) => {
        evt.preventDefault();
        alert(`Submitting Name ${email} and password: ${password}`)
    }
  return (
    <div>
        <Container>
      <Form onSubmit={handleSubmit}>
  <Form.Group controlId="userEmail">
    <Form.Label>Email address</Form.Label>
    <Form.Control type="email" id="email" onChange={e => setEmail(e.target.value)} placeholder="Enter email" />
    <Form.Text className="text-muted">
      We'll never share your email with anyone else.
    </Form.Text>
  </Form.Group>

  <Form.Group controlId="password">
    <Form.Label>Password</Form.Label>
    <Form.Control type="password" id="password" onChange={e => setPassword(e.target.value)} placeholder="Password" />
  </Form.Group>
  <Form.Group controlId="passwordConfirm">
    <Form.Label>Re-Enter Password</Form.Label>
    <Form.Control type="password" id="password" onChange={e => setRePassword(e.target.value)} placeholder="Re-type Password" />
  </Form.Group>
  <Button variant="primary" type="submit">
    Submit
  </Button>
</Form>
</Container>
    </div>
  );
}


export default UserRegistration;
